window.bookSummaryJSON = "<p><b>J. S. Dewes continues her fast paced, science fiction action adventure series, the Divide, with </b><b><i>The Exiled Fleet</i></b><b>, where </b><b><i>The Expanse</i></b><b> meets </b><b><i>The Black Company</i></b><b>â€”the survivors of </b><b><i>The Last Watch</i></b><b> refuse to die.</b></p> <p>The Sentinels narrowly escaped the collapsing edge of the Divide.</p> <p>They have mustered a few other surviving Sentinels, but with no engines they have no way to leave the edge of the universe before they starve.</p> <p>Adequin Rake has gathered a team to find the materials they'll need to get everyone out.</p> <p>To do that they're going to need new allies and evade a ruthless enemy. Some of them will not survive.<br> <br> <b>The Divide series</b><br> <i>The Last Watch</i><br> <i>The Exiled Fleet</i></p> <p><b>A Macmillan Audio production from Tor Books </b></p>"; 
